import Index from './pages/Index';
import About from './pages/About';


class App extends Component {

  render() {
    return (
      <Router>
        <Loading
            show={loading}
            color="red"/>
        <Header/>
        <Route path="/" exact component={Index}/>
        <Route path="/about" exact component={About}/>
        <Footer/>
